@ProcessorTest @WithClasses({
        ErroneousOrganizationMapper2.class,
        OrganizationWithoutTypeGetterEntity.class
    })@ExpectedCompilationOutcome(
        value = CompilationResult.FAILED,
        diagnostics ={
            @Diagnostic(type = ErroneousOrganizationMapper2.class,
                kind = javax.tools.Diagnostic.Kind.ERROR,
                line = 23,
                message = "No read accessor found for property \"type\" in target type."),
            @Diagnostic(type = ErroneousOrganizationMapper2.class,
                kind = javax.tools.Diagnostic.Kind.ERROR,
                line = 35,
                message = "ErroneousOrganizationMapper2.DepartmentEntity does not have an accessible constructor.")

        }

@ProcessorTest @WithClasses({
        ErroneousMapper.class,
        Region.class,
    })@ExpectedCompilationOutcome(
        value = CompilationResult.FAILED,
        diagnostics ={
            @Diagnostic(type = ErroneousMapper.class,
                kind = javax.tools.Diagnostic.Kind.ERROR,
                line = 18,
                message = "Constant and default value are both defined in @Mapping, either define a defaultValue or a" +
                    " constant."),
            @Diagnostic(type = ErroneousMapper.class,
                kind = javax.tools.Diagnostic.Kind.ERROR,
                line = 20,
                message = "Can't map property \"Region region\" to \"String region\". " +
                    "Consider to declare/implement a mapping method: \"String map(Region value)\".")
        }

